import React, { Component } from "react";

class Review extends Component {
  render() {
    return (
      <div>
        <h4>Rating: 4.1</h4>
        <ul>
          <li>Author: Tatyana Olson</li>
          <li>
            Body: How bitter a thing it is to look into happiness through
            another man's eyes!
          </li>
          <li>Publish Date: 3-9-16</li>
          <li>ID: 9784620626604</li>
        </ul>
      </div>
    );
  }
}

export default Review;
